-- 테이블 순서는 관계를 고려하여 한 번에 실행해도 에러가 발생하지 않게 정렬되었습니다.

-- Board Table Create SQL
CREATE TABLE Board
(
    BNum         NUMBER            NOT NULL, 
    BTitle       VARCHAR2(1000)    NULL, 
    BContent     VARCHAR2(1000)    NULL, 
    BDate        DATE              NULL, 
    ID           VARCHAR2(1000)    NULL, 
    Authority    NUMBER            NULL, 
    Views        NUMBER            NULL, 
    CONSTRAINT BOARD_PK PRIMARY KEY (BNum)
)
/

CREATE SEQUENCE Board_SEQ
START WITH 1
INCREMENT BY 1;
/

CREATE OR REPLACE TRIGGER Board_AI_TRG
BEFORE INSERT ON Board 
REFERENCING NEW AS NEW FOR EACH ROW 
BEGIN 
    SELECT Board_SEQ.NEXTVAL
    INTO :NEW.BNum
    FROM DUAL;
END;
/


SELECT *
    FROM (
        SELECT *
        FROM board
        WHERE bTitle LIKE '%BTitle%'
        ORDER BY BNum DESC
        )
    WHERE ROWNUM <= 3;
